import React from 'react'
import { getNotes } from '../utils/noteHelpers'
import ListGroup from 'react-bootstrap/ListGroup'

export default function List() {
	return (
		<ListGroup>
			{getNotes().map((note) => (
				<ListGroup.Item action variant="danger">
					{note.title}
				</ListGroup.Item>
			))}
		</ListGroup>
	)
}
